import React from 'react';
import LocationItem from './LocationItem';

import classes from './LocationList.module.scss';

const LocationList = (props) => {
  const locations = [
    {
      city: 'Downtown',
      address: '1601 S. 1st Street, Austin TX 78704',
      hours: 'Mon - Fri 9 AM - 9 PM, Sat - Sun 9 AM - 9 PM',
      mapLocation: {
        lng: 53.51257,
        lat:  49.290987227453165,
      },
    },

    {
      city: 'South First',
      address: '4200 S. 1st Street, Austin TX 78704',
      hours: '11 AM - 7 PM 7 days a week',
      mapLocation: {
        lng: -97.8007903,
        lat: 30.2309551,
      },
    },

    {
      city: 'Westgate',
      address: '4525 Westgate Blvd, Austin TX 78704',
      hours: 'Mon - Fri 9 AM - 9 PM, Sat - Sun 9 AM - 9 PM',
      mapLocation: {
        lng: -97.7550878,
        lat: 30.2490687,
      },
    },
  ];

  return (
    <ul className={classes.List}>
      {locations.map((location) => {
        return (
          <LocationItem
            locationHandler={props.locationHandler}
            key={location.city}
            data={location}
          />
        );
      })}
    </ul>
  );
};

export default LocationList;
